import { useEffect, useState } from "react";
import "./App.css";

const App = () => {
  useEffect(() => {
    fetch("/global-data")
      .then((data) => {
        data.json();
      })
      .then((result) => console.log(result))
      .catch((err) => console.log("error occurred"));
  }, []);
  return <div></div>;
};

export default App;
